import { BrowserRouter, Route, Routes } from "react-router-dom";
import './App.css';
import Navbar from './components/navbar';
import home from "./screens/home";

function App() {
  return (
    <div className="App">
      <Navbar/>

      <BrowserRouter>
        <Toaster position="top-center" reverseOrder={false} />
        <routes>
        <Route path="/home" element={<home/>}/>
        </routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
